import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from "react-router-dom";import logo from './logo.svg';
import './App.css';
import Saved from "./pages/Saved"
import Search from "./pages/Search"


function App() {
  return (
    <Router>
      <div className="App">
      <header>
        <h3>Google Books</h3>
        <Link to="/saved">Saved Books</Link>
        <a link to="/search">Search More</a>
      </header>
        <Switch>
          <Route
            exact path="/saved"
            component={Saved}
          />
          <Route
            exact path="/search"
            component={Search}
          />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
